    return (
    <>
    <table>
      <Row>
      <ul>
        <li>
        <Col>
        {`${cart.dish_name}`}
        </Col>
        <Col>
        {`${cart.price}`}
        </Col>
        <Col>
        {`${cart.dish_category}`}
        </Col>
       </li>
      </ul>
        </Row>
    </table>
    </>
    );
}

export default AddtoCartItemOrderFood;
